//Player 1 attack event listener

function attacks(){
    const cells = document.querySelectorAll(".cell-2");
    cells.forEach(cell => {
        cell.addEventListener("click", (e) => {
            let [x,y] = e.target.id.split(",");
            player2.attack(x,y);
            player2.gameboard.renderUpdate(".cell-2");
            if (player2.gameboard.gameOver()){
                alert("Player Wins");
            }
            robotAttack();
            
        })
    })
}

